import React, { useState } from 'react';
import './style.css';
import { useNavigate } from 'react-router-dom';
import FeedSelector from "./FeedSelector";

const ResultsPage = () => {

  const navigate = useNavigate();
  const goToHomePage = () => { navigate('/'); };
  const goToComparisonPage = () => { navigate('/comparison'); };

  const [selectedCategory, setSelectedCategory] = useState("all");

  const handleCategoryClick = (category) => {
    setSelectedCategory(category);
  };

  return (
    <div className="resultspage">
      <nav>
        <div id="nav-links">
            <a onClick={goToHomePage}> About Us</a>
            <a onClick={goToComparisonPage}>Comparison Tool</a>
        </div>
        <span>Project Title</span>
      </nav>
      <div id="title">
          <div id="page-title">Feed Comparison Results</div>
      </div> 

      <div class="feeds-container">
        <FeedSelector key={selectedCategory} selectedCategory={selectedCategory} />
      </div>
    </div>
  );
}

export default ResultsPage;
